import Admin from "./pages/Admin";
import Auth from "./pages/Auth";
import DevicePage from "./pages/DevicePage";
import Shop from "./pages/Shop";
import { ADMIN_ROUTE, SHOP_ROUTE,PROFILE_ROUTE, LOGIN_ROUTE, REGISTRATION_ROUTE, DEVICE_ROUTE } from "./utils/const"; // Добавьте CHAT_ROUTE
import UserProfile from './pages/UserInfo';

export const authRoutes = [
    {
        path: ADMIN_ROUTE,
        Component: Admin
    },
      { path: PROFILE_ROUTE, Component: UserProfile }
    
];

export const publicRoutes = [
    {
        path: SHOP_ROUTE,
        Component: Shop
    },
    {
        path: LOGIN_ROUTE,
        Component: Auth
    },
    {
        path: REGISTRATION_ROUTE,
        Component: Auth
    },
    {
         path: DEVICE_ROUTE + '/:id',
        Component: DevicePage
    }
];
